import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the 'View All →' link to be visible and click it
    await page.waitForSelector('a.view-all-link', { state: 'visible' });
    await page.click('a.view-all-link');

    // Wait for the dashboard page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot after navigating to the dashboard
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_dashboard.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_dashboard.png'));

    // Extract meaningful data to verify task completion
    const pageTitle = await page.title();
    const currentUrl = page.url();

    return {
      success: true,
      action: "Clicked 'View All →' link and navigated to dashboard",
      extractedData: {
        title: pageTitle,
        url: currentUrl
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

